import React, { Component } from 'react';
import { ScrollView, View, Alert, TouchableWithoutFeedback, Keyboard, KeyboardAvoidingView, StyleSheet } from 'react-native';
import { TextInput, Button, Card, Avatar, Title, Snackbar, Appbar, Provider as PaperProvider } from 'react-native-paper';
import { setStatusBarHidden, StatusBar } from 'expo-status-bar';

class SignIn extends Component {

    constructor(props) {
        super(props)
        this.state = {
            emailID: "",
            password: "",
        }
    }

    onSignIn = () =>
        Alert.alert(
            "Alert Title",
            "My Alert Msg",
            [
                {
                    text: "Cancel",
                    onPress: () => console.log("Cancel Pressed"),
                    style: "cancel"
                },
                { text: "OK", onPress: () => console.log("OK Pressed") }
            ],
            { cancelable: false }
        );

    render() {
        const { password, emailID } = this.state;

        const styles = StyleSheet.create({
            container: {
                flex: 1
            },
            inner: {
                padding: 24,
                flex: 1,
                justifyContent: "space-around"
            },
            header: {
                fontSize: 36,
                marginBottom: 48
            },
            textInput: {
                height: 40,
                borderColor: "#000000",
                borderBottomWidth: 1,
                marginBottom: 36
            },
            btnContainer: {
                backgroundColor: "white",
                marginTop: 12
            }
        });

        return (
            <KeyboardAvoidingView
                behavior={Platform.OS === "ios" ? "padding" : "height"}
                style={styles.container}
            >
                <TouchableWithoutFeedback onPress={Keyboard.dismiss}>
                    <View style={{ flex: 1, justifyContent: 'center' }}>
                        <View style={{ width: '100%', alignSelf: 'center' }}>
                            <StatusBar style="auto" />
                            <Card>
                                <Card.Content>
                                    <Title>Sign In</Title>
                                    <TextInput
                                        label="Email Address"
                                        value={emailID}
                                        onChangeText={text => this.setState({ emailID: text })}
                                    />
                                    <TextInput
                                        style={{ marginTop: 10 }}
                                        secureTextEntry={true}
                                        label="Password"
                                        value={password}
                                        onChangeText={text => this.setState({ password: text })}
                                    />
                                    <Card.Actions style={{ justifyContent: 'center' }}>
                                        <Button style={{ marginTop: 10, justifyContent: 'center' }} contentStyle={{ height: 50 }}
                                            icon='login' mode="contained"
                                            onPress={() => this.onSignIn()}>
                                            Sign In
                                </Button>
                                    </Card.Actions>
                                </Card.Content>
                            </Card>
                        </View>
                    </View>
                </TouchableWithoutFeedback>
            </KeyboardAvoidingView>
        )
    }
}

export default SignIn
